import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'

let currTime = new Date();
let time = currTime.getHours();
var greeting = "";

const h1Style = {
  padding: '50px',
  borderRadius: '45px',
  backgroundColor: 'rgba(252, 209, 209, 0.712)',
  color: 'rgb(184, 55, 55)',
  fontSize: '3rem'
}

ReactDOM.render(
  <h1 style={h1Style}>Hello Sir, <span style={h1Span}> {greeting} </span></h1>
  ,
  document.getElementById('root')
)
